import React from 'react';
import './App.css';
import Home from './components/Home';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import NormalCar from './components/NormalCar';

function App() {
  const AbstractEngine = [
    {
    id: 1,
    EngineType: "V8"
  },
  {
    id: 2,
    EngineType: "V7"
  },
  {
    id: 3,
    EngineType: "V6"
  },
  {
    id: 4,
    EngineType: "V5"
  }
]
  const AbstractDoor = [
    {
      id: 1,
      color: "blue",
    },
    {
      id: 1,
      color: "blue",
    },
    {
      id: 1,
      color: "blue",
    }
]
  const AbstractWindow = [
    {
    id: 1,
    color:"transparant"
  }
]
  const AbstractTire = [
    {
    id: 1,
    color:"rood",
    BrandName: "Michelin",
  }
]
  const AbstractRim = [
    {
    id: 1,
    color: "chrome",
  }
]
  return (
    <div className="App">
      <BrowserRouter>
          <Routes>
              <Route path='/' element={<Home/>}/>
                  <Route 
                  path='/normale-auto'
                   element=
                   {
                   <NormalCar
                    engine={AbstractEngine}
                    doors={AbstractDoor}
                    windows={AbstractWindow}
                    tires={AbstractTire}
                    rims={AbstractRim}
                   />
                   }/>    
          </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
